// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract VotingSystem {
    // State variables to store the votes
    struct Proposal {
        string name;
        uint256 voteCount;
    }

    address public admin;
    mapping(address => bool) public hasVoted;
    Proposal[] public proposals;
    mapping(uint256 => Proposal) public proposalById;

    // Event to log new proposals
    event ProposalCreated(uint256 proposalId, string name);

    // Event to log votes
    event VoteCasted(uint256 proposalId, address voter);

    // Constructor to initialize the contract
    constructor() {
        admin = msg.sender;
    }

    // Function to create a new proposal
    function createProposal(string memory name) public {
        require(msg.sender == admin, "Only admin can create proposals");
        uint256 proposalId = proposals.length;
        proposals.push(Proposal({
            name: name,
            voteCount: 0
        }));
        proposalById[proposalId] = proposals[proposalId];
        emit ProposalCreated(proposalId, name);
    }

    // Function to vote for a proposal
    function vote(uint256 proposalId) public {
        require(proposalId < proposals.length, "Invalid proposal ID");
        require(!hasVoted[msg.sender], "You have already voted");
        hasVoted[msg.sender] = true;
        proposalById[proposalId].voteCount += 1;
        emit VoteCasted(proposalId, msg.sender);
    }

    // Function to get the vote count of a proposal
    function getVoteCount(uint256 proposalId) public view returns (uint256) {
        require(proposalId < proposals.length, "Invalid proposal ID");
        return proposalById[proposalId].voteCount;
    }

    // Function to get the name of a proposal
    function getProposalName(uint256 proposalId) public view returns (string memory) {
        require(proposalId < proposals.length, "Invalid proposal ID");
        return proposalById[proposalId].name;
    }
}

